INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, 'https://www.drupal.org/documentation/modules/aggregator', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, 'https://www.drupal.org/project/switchtheme\r\n\r\nСтворює блок в котрому користувач може змінити тему сайту. Доступні налаштування надання доступу для користувачів окремих ролей.', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, '<p>Who''s online - користувачі онлайн.</p>\r\n\r\n<p>Who''s new - нові користувачі.</p>\r\n\r\n<p>User menu - меню включає в собі два пункти&nbsp;logout i My account коли користувач авторизований і login - коли не авторизований.</p>\r\n\r\n<p>Syndicate - блок трансляції RSS.</p>\r\n\r\n<p>Shortcuts - корисна штука, створює блок закладок. Наприклад буває що дуже часто потрібно запускати cron. Він знаходиться за шляхом /admin/config/system/cron. Кожен раз незручно переходити в меню до нього. Заходим на нього&nbsp;<img alt="Виділення_001.png" height="33" src="/cobbler/public_html/sites/default/files/image/%D0%92%D0%B8%D0%B4%D1%96%D0%BB%D0%B5%D0%BD%D0%BD%D1%8F_001.png" width="86" />&nbsp;і натискаємо на оцей маленький плюсик. Він означає добавити в закладки для цього модуля.&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, '<h2>Коротко о программе.</h2>\r\n\r\n<p><strong><em>Shutter</em></strong>&nbsp;является многофункциональной программой для создания снимков экрана. Вы можете сделать скриншот определенной области, окна, всех экранов сразу, или веб-сайта.<br />\r\nЕсть&nbsp;<strong>встроенный редактор</strong>&nbsp;(<em>вызывается по нажатию кнопки "Правка"</em>), и можно сразу применитьразличные эффекты к скриншоту: рисовать на нем, выделять пункты, обрезать изображения и многое другое, размывать публичные данные и прочее-прочее.</p>\r\n\r\n<p><strong>Установка Shutter в Ubuntu 14.04</strong></p>\r\n\r\n<p><strong>Все команды будут вводится в терминале (<em>CTR-ALT-T</em>)</strong>.<br />\r\nДля установки последней версии&nbsp;<strong>Shutter 0.90 в Ubuntu</strong>:&nbsp;<br />\r\n<u><strong>1.</strong></u>&nbsp;Добавляем&nbsp;<em>репозиторий</em>&nbsp;в систему:</p>\r\n\r\n<p>sudo add-apt-repository ppa:shutter/ppa</p>\r\n\r\n<p><u><strong>2.</strong></u>&nbsp;Обновляем сведения о&nbsp;<em>репозиториях</em>: &nbsp;</p>\r\n\r\n<p>sudo apt-get update</p>\r\n\r\n<p><u><strong>3.</strong></u>&nbsp;Устанавливаем программу:</p>\r\n\r\n<p>sudo apt-get install shutter</p>\r\n\r\n<p>Всё установка завершена, программу теперь можно найти в меню&nbsp;<strong>Dash.</strong></p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, '<p><strong>Skype&nbsp;</strong></p>\r\n\r\n<p>sg.mykola.v</p>\r\n\r\n<p>yfdxfyyzcgjhn13</p>\r\n\r\n<p><strong>drupal.org</strong></p>\r\n\r\n<p>Veriga</p>\r\n\r\n<p>fkmjyrf1</p>\r\n\r\n<p><strong>Робота Ubuntu</strong></p>\r\n\r\n<p>veriga</p>\r\n\r\n<p>fkmjyrf1</p>\r\n\r\n<p><strong>Робота сервер Windows</strong></p>\r\n\r\n<p>veriga</p>\r\n\r\n<p>yfdxfyyzcgjhn13</p>\r\n\r\n<p><strong>vk.com</strong></p>\r\n\r\n<p>380660684211</p>\r\n\r\n<p>yfdxfyyzcgjhn13</p>\r\n\r\n<p><strong>google.com</strong></p>\r\n\r\n<p>sg.mykola.v@gmail.com</p>\r\n\r\n<p>yfdxfyyzcgjhn13</p>\r\n\r\n<p><strong>SoftGroup&nbsp;</strong></p>\r\n\r\n<p>http://workload.softgroup.ua - таблиця завантаженості&nbsp;<br />\r\nhttp://contacts.softgroup.ua - таблиця контактів</p>\r\n\r\n<p>Доступно для редагування тільки з аккаунта google sg.mykola.v</p>\r\n\r\n<p><strong>Clickatell - cервіс розсилки смс</strong></p>\r\n\r\n<p>VerigaSG</p>\r\n\r\n<p>CUcPFDcVSecDbL</p>\r\n\r\n<p><strong>Aukro</strong></p>\r\n\r\n<p>veriga</p>\r\n\r\n<p>yfdxfyyzcgjhn1</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'filtered_html'),
