('node', 'article', 0, 10, 10, 'und', 0, '<p>Для &nbsp;зручної організації загрузки картинок в Drupal 7 можна використати модуль IMCE що інтегрується у графічний редактор CKEditor.&nbsp;</p>\r\n\r\n<p>1. Встановити модуль&nbsp;<br />\r\nhttps://www.drupal.org/project/imce</p>\r\n\r\n<p>2. У налаштуваннях&nbsp;&nbsp;CKEditor&nbsp;/admin/config/content/ckeditor у необхідних профілях в&nbsp;SHOWEDITOR APPEARANCE перенести іконку IMCE в Current toolbar.</p>\r\n\r\n<p>І увімкнути&nbsp;Plugin for inserting files from IMCE without image dialog</p>\r\n', '', 'filtered_html');
