(2, 'node', ' switchtheme https wwwdrupalorg project switchtheme створює блок в котрому користувач може змінити тему сайту доступні налаштування надання доступу для користувачів окремих ролей theme модулі ', 0),
(3, 'node', ' блоки ядра drupal 7 who s online користувачі онлайн who s new нові користувачі user menu меню включає в собі два пункти logout i my account коли користувач авторизований і login коли не авторизований syndicate блок трансляції rss shortcuts корисна штука блок закладок наприклад буває що дуже часто потрібно запускати cron він знаходиться за шляхом admin config system cron кожен раз незручно переходити в меню до нього заходим на нього  core ', 1474826970),
(4, 'node', ' прога для скріншотів shutter коротко о программе shutter  является многофункциональной программой для создания снимков экрана вы можете сделать скриншот определенной области окна всех экранов сразу или вебсайта есть  встроенный редактор   вызывается по нажатию кнопки правка   и можно сразу применитьразличные эффекты к скриншоту рисовать на нем выделять пункты обрезать изображения и многое другое размывать публичные данные и прочеепрочее установка shutter в ubuntu 1404 все команды будут вводится в терминале  ctraltt    для установки последней версии  shutter 90 в ubuntu   1  добавляем  репозиторий  в систему sudo addaptrepository ppa shutter ppa 2  обновляем сведения о  репозиториях  sudo aptget update 3  устанавливаем программу sudo aptget install shutter всё установка завершена программу теперь можно найти в меню  dash загальна категорія ', 0),
(5, 'node', ' дані від аккаунтів соцмереж та сайтів skype  sgmykolav yfdxfyyzcgjhn13 drupalorg veriga fkmjyrf1 робота ubuntu veriga fkmjyrf1 робота сервер windows veriga yfdxfyyzcgjhn13 vkcom 380660684211 yfdxfyyzcgjhn13 googlecom sgmykolav gmailcom yfdxfyyzcgjhn13  конфіденційно ', 1474824587);
